  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Atchafalaya
  National Wildlife Refuge summarizes refuge activities during 1990.  The report begins
  with information about the yearu2019s highlights and climatic conditions.   Land
  acquisition- including fee title, easements, and boundary surveys- is also covered.
  \ The report includes a planning section which discusses compliance with environmental
  mandates.  Refuge administration is outlined; lists of personnel, funding sources,
  and safety programs are given.  Habitat management is also covered.  Subjects include
  general habitats, wetlands, forests, and croplands.  The wildlife section of the
  report discusses wildlife diversity, endangered/threatened species, waterfowl, marsh/water
  birds, shorebirds, raptors, game animals, fisheries resources, wildlife propagation
  and stocking, and banding, and disease control.  The public uses of the refuge described
  in this report include general use, interpretive foot trails, hunting, fishing,
  trapping, wildlife observation, camping, picnicking, and law enforcement.\",\n\t\"license_title\":
